import React from "react";
import { Box, Typography, Button } from "@mui/material";

const Home = () => {
  return (
    <Box
      sx={{
        position: "relative",
        height: "100vh",
        backgroundImage: `url('https://www.google.com/url?sa=i&url=https%3A%2F%2Fwww.espace-concours.fr%2Fcuisine%2Frestauration-collective-qualites-requises&psig=AOvVaw3u-ZnGP7MF7OrdhCrtVvqf&ust=1735344628753000&source=images&cd=vfe&opi=89978449&ved=0CBEQjRxqFwoTCIis59TUxooDFQAAAAAdAAAAABAE')`, // Remplacez par l'URL de votre image
        backgroundSize: "cover",
        backgroundPosition: "center",
      }}
    >
      {/* Overlay pour assombrir l'image */}
      <Box
        sx={{
          position: "absolute",
          top: 0,
          left: 0,
          right: 0,
          bottom: 0,
          backgroundColor: "rgba(0, 0, 0, 0.5)",
        }}
      />

      {/* Contenu superpos√© */}
      <Box
        sx={{
          position: "relative",
          zIndex: 2,
          color: "#fff",
          textAlign: "center",
          top: "50%",
          transform: "translateY(-50%)",
        }}
      >
        <Typography variant="h2" gutterBottom>
          Welcome to Our Restaurant
        </Typography>
        <Typography variant="h6" gutterBottom>
          Discover our delicious menu and make a reservation today!
        </Typography>
        <Button variant="contained" color="secondary" href="/menu" sx={{ mt: 2 }}>
          Explore Menu
        </Button>
      </Box>
    </Box>
  );
};

export default Home;
